import { ListGroup } from "react-bootstrap";
function IServicesItem(props) {
  return (
  <div className="IServicesItem" >
    <ListGroup.Item className="IServicesHead" action href="#link1">
      {props.title}

    <img src={props.src}className="IServicesItemImg" />
    </ListGroup.Item>
  </div>
  );
}
export default IServicesItem;
